import { Props } from './Alies';

type Props2 =  Props & {
  value: string;
};

const YardsRecovered:React.FC<Props2> = ({register,value})  => {
    if (value==="Punt" || value==="Kick Off"){
        return (
          <>
          <div className="mx-2 "><h5>Yards Returened</h5></div>
             <input type="number" {...register("yards_recovered",{ setValueAs: (value) => parseInt(value), })} className="col-10 col-sm-3"/>
          </>
        )
      }
      return null   
}

export default YardsRecovered
